-- Table: admins
DROP TABLE IF EXISTS "admins" CASCADE;
CREATE TABLE "admins" (
  "id" integer NOT NULL DEFAULT nextval('admins_id_seq'::regclass),
  "username" text NOT NULL,
  "password_hash" text NOT NULL,
  "role" character varying DEFAULT 'admin'::character varying,
  "created_at" timestamp with time zone DEFAULT now()
);


-- Table: analytics
DROP TABLE IF EXISTS "analytics" CASCADE;
CREATE TABLE "analytics" (
  "id" uuid NOT NULL DEFAULT gen_random_uuid(),
  "page_url" text NOT NULL,
  "ip_address" text,
  "user_agent" text,
  "created_at" timestamp with time zone DEFAULT CURRENT_TIMESTAMP
);


-- Table: appeals
DROP TABLE IF EXISTS "appeals" CASCADE;
CREATE TABLE "appeals" (
  "id" uuid NOT NULL DEFAULT gen_random_uuid(),
  "submitted_by" character varying NOT NULL,
  "submitted_by_role" character varying NOT NULL,
  "event_name" character varying NOT NULL,
  "reason" character varying NOT NULL,
  "description" text,
  "status" character varying DEFAULT 'Pending'::character varying,
  "created_at" timestamp without time zone DEFAULT CURRENT_TIMESTAMP,
  "payment_order_id" character varying,
  "payment_id" character varying,
  "payment_status" character varying DEFAULT 'pending'::character varying,
  "updated_at" timestamp without time zone DEFAULT CURRENT_TIMESTAMP,
  "refund_status" character varying
);


-- Table: audit_logs
DROP TABLE IF EXISTS "audit_logs" CASCADE;
CREATE TABLE "audit_logs" (
  "id" integer NOT NULL DEFAULT nextval('audit_logs_id_seq'::regclass),
  "admin_id" integer,
  "action" text,
  "details" jsonb,
  "created_at" timestamp with time zone DEFAULT now()
);

-- Table: candidates
DROP TABLE IF EXISTS "candidates" CASCADE;
CREATE TABLE "candidates" (
  "id" uuid NOT NULL DEFAULT uuid_generate_v4(),
  "chest_no" character varying NOT NULL,
  "name" character varying NOT NULL,
  "team_code" character varying,
  "category" character varying,
  "role" character varying
);


-- Table: committee_members
DROP TABLE IF EXISTS "committee_members" CASCADE;
CREATE TABLE "committee_members" (
  "id" uuid NOT NULL DEFAULT uuid_generate_v4(),
  "name" character varying NOT NULL,
  "role" character varying NOT NULL,
  "email" character varying,
  "phone" character varying,
  "image" text,
  "display_order" integer DEFAULT 0,
  "department" character varying
);


-- Table: events
DROP TABLE IF EXISTS "events" CASCADE;
CREATE TABLE "events" (
  "id" uuid NOT NULL DEFAULT uuid_generate_v4(),
  "code" character varying NOT NULL,
  "name" character varying NOT NULL,
  "event_type" character varying NOT NULL,
  "item_type" character varying NOT NULL,
  "category" character varying,
  "status" character varying DEFAULT 'Pending'::character varying
);


-- Table: participants
DROP TABLE IF EXISTS "participants" CASCADE;
CREATE TABLE "participants" (
  "id" uuid NOT NULL DEFAULT uuid_generate_v4(),
  "event_id" uuid,
  "candidate_id" uuid,
  "team_code" character varying,
  "status" character varying DEFAULT 'Pending'::character varying,
  "position" integer,
  "grade" character varying,
  "points" integer DEFAULT 0,
  "work_url" text
);


-- Table: teams
DROP TABLE IF EXISTS "teams" CASCADE;
CREATE TABLE "teams" (
  "code" character varying NOT NULL,
  "name" character varying NOT NULL,
  "total_points" integer DEFAULT 0,
  "password_hash" character varying
);


